Text:
@dkhere: Keep up with the times, a SCREENER is a DVDRIP. The ONLY difference is that it is supposed to be restricted for viewing unless you have special permission from the movie studio that made the film. . . For example, Movie Reviewers that are BIG TIME names Like Gene Siskel or Leonard Malton. These real DVD's  are also made to be viewed by people in the film ACADEMY (as in the ADAMEY AWARDS). They end up on the web because someone at the Studio itself or a person that was able to handle the DVD that is an employee of the TV studio where a Movie Critic's show is made. Anyone that is lucky enough to have an hour or so and a FAST as HELL lap top can copy the disk and return it before anyone is aware it was even moved from where ever it is kept.  SO, for ALL who are un-informed, if it is a TRUE SCREENER, it is the exact same quality as the retail version and is DEFINITELY NOT a CAM nor is its quality super shitty like most CAMS are. It may have a "watermark" in the form of a message explaining that this is only been issued for the purpose of movie reviewers and is not for the public. A message like this will appear at the top or bottom of the screen maybe 4 times spread throughout the film and these WATERMARKS may only last 10 or 15 seconds and are usually smaller text then even a subtitle so in no way does it diminish the quality or watchability. I have seen comments like this person made all the time. It is amazing that there are so many people that will NOT download a given film because they wrongly think a Screener (sometimes abrevreated as SCR) is some type of CAM. The audio is the same as the retail as well. If it will be a BLU-RAY when it hits the stores, the SCREENER will be Blu-Ray also. hope this helps some of the NEWBS

